// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;


contract VoteTest {

    mapping(uint256 => PeriodVoteResult) _periodResultMap;
    mapping(uint256 => Voter[]) _periodVoterMap;
    PeriodVoteResult[] resultList;

    constructor() {
        for (uint i=1;i<=10;i++) {
            _periodResultMap[i] = PeriodVoteResult({_periodNum:i, _amount:i+1, _voteResult:2, _isHandled:false});
        }
    }

    struct PeriodVoteResult {
        // 期数
        uint256 _periodNum;
        // 投注数量
        uint256 _amount;
        // 竞猜结果(0:小，1：大，2：未开奖)
        uint256 _voteResult;
        // 处理结果
        bool _isHandled;
    }

    struct Voter {
        // 账号
        address _account;
        // 期数
        uint256 _periodNum;
        // 投注数量
        uint256 _amount;
        // 投注目标
        uint256 _vote;
        // 开奖结果(0:小，1：大，2：未开奖)
        uint256 _result;
        // 赢取数量
        uint256 _winAmount;
    }

    /**
     * 生成竞猜结果（大或者小）
     */
    function generateVoteResult() public {
        // 遍历所有期数生成竞猜结果
        // for (uint256 i=1;i<(block.number / 20);i++) {
        for (uint i=1;i<=10;i++) {
            PeriodVoteResult storage periodVoteResult = _periodResultMap[i];
            // // 遍历当期之前的所有期数
            if (periodVoteResult._periodNum == i && !periodVoteResult._isHandled) {
                _periodResultMap[i]._voteResult = uint256(keccak256(abi.encodePacked(block.difficulty, block.timestamp)))%2;
                if (sendAwards(periodVoteResult)) {
                    _periodResultMap[i]._isHandled = true;
                }
            }
            resultList.push(_periodResultMap[i]);
        }
    }
    function getMap() public view returns (PeriodVoteResult[] memory){
        return resultList;
    }
    /**
     * 派奖
     */
    function sendAwards(PeriodVoteResult memory periodVoteResult) public returns (bool) {
        // 未处理过的才派奖，并且是历史期数
        require(!periodVoteResult._isHandled);
        require(periodVoteResult._periodNum < (block.number / 20));

        Voter[] storage periodVoterList = _periodVoterMap[periodVoteResult._periodNum];
        for(uint i = 0; i < periodVoterList.length; i++) {
            Voter storage voter = periodVoterList[i];
            if (voter._vote == periodVoteResult._voteResult) {
                // 10%给平台
                voter._winAmount = voter._amount * 9 / (10 * periodVoteResult._amount);
                if (voter._winAmount > 0) {
                    // 转账打钱
                }
            }
        }

        return true;
    }
}
